INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 401, 24, 2, "アヤネ", 0.0, 102301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 402, 24, 1, "アヤネ", 2.21, 102301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 403, 24, 2, "アヤネ", 0.0, 102301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 701, 24, 2, "アサヒ", 1.99, 192201, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 702, 24, 1, "アサヒ", 2.21, 192201, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 703, 24, 2, "アサヒ", 3.33, 192201, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 801, 24, 2, "部員３", 0.0, 192301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 802, 24, 1, "部員３", 2.68, 192301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 803, 24, 2, "部員３", 0.0, 192301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24010, "やった！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 501, 24, 1, "", 0.0, 192501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24011, "勝ったよ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 502, 24, 1, "", 0.0, 192501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24012, "いい調子！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 503, 24, 1, "", 0.0, 192501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 111, 24, 6, "ミサト", 5.33, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 112, 24, 1, "ミサト", 6.85, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 113, 24, 1, "ミサト", 3.0, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 611, 24, 1, "ダイチ", 6.11, 192401, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 612, 24, 1, "ダイチ", 6.75, 192401, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 613, 24, 2, "ダイチ", 0.0, 192401, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 211, 24, 2, "ハツネ", 4.52, 113401, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 212, 24, 2, "ハツネ", 3.89, 113401, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 213, 24, 1, "ハツネ", 13.49, 113401, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 311, 24, 1, "カヤ", 3.17, 106501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, 0.0, 312, 24, 1, "カヤ", 4.42, 106501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 313, 24, 6, "カヤ", 2.89, 106501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 10046, 0.0, 421, 24, 4, "アヤネ", 3.71, 102301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 721, 24, 2, "アサヒ", 5.1, 192201, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 10046, 0.0, 821, 24, 1, "部員３", 4.34, 192301, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24028, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, 0.0, 521, 24, 1, "", 0.0, 192501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, -360.0, 101, 24, 1, "ミサト", 5.62, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, -360.0, 102, 24, 1, "ミサト", 9.58, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, -360.0, 103, 24, 2, "ミサト", 0.0, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 10046, -360.0, 104, 24, 2, "ミサト", 9.13, 113501, 0.0);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 10046, -360.0, 105, 24, 1, "ミサト", 8.27, 113501, 0.0);
